import React, { Component } from 'react'

export default class  extends Component {
    render() {
        return (
            <div>
                <div className="content3">
                    <table>
                        <tr>
                            <th>Sr. No.</th>
                            <th>Doctor Name</th>
                            <th>Speciality</th>
                            <th>Timing</th>
                        </tr>
                    </table>
                </div>
            </div>
        )
    }
}
